import logo from "./logo.svg";
import "./App.css";
import "./Flex.css";
import HorizonLine from "./Horizontalline";

function App() {
  return (
    <div className="container">
      <div className="side"></div>
      <div className="center">
        <div>
          <h1>기본정보</h1>
          <HorizonLine />
        </div>
        <div className="container">
          <h2>상품 이미지</h2>
          <span>(0/10)</span>
        </div>
      </div>
      <div className="side"></div>
    </div>
  );
}

export default App;
